	margin: 2em 0 1em auto;
	border-radius: 6px 0;
`;

const SearchEntry = styled.div`

`

const Search = ({ logout, deleteUser, isAuthenticated }) => {
	const deleteHandler = () => {
		// setAuthToken();

		return <Redirect to='/' />;
		deleteUser();
	};
	const logoutHandler = () => {
		console.log('logout')

		return <Redirect to='/' />;
		logout();
	};
	return (
		<SearchEntry>
				<SearchButton onClick={logout}>Logout</SearchButton>
	
		</SearchEntry>
	);
};

export default Search;
